import { Navbar } from './Navbar/navbar/navbar';     // adjust path if needed
import {Aboutus} from './comment/aboutus/aboutus';

@Component({
  selector: 'app-root',
  standalone: true,
  imports: [
    RouterOutlet,
    Navbar,
    Aboutus,
  ],
  template: `


    <navbar></navbar>
    <router-outlet></router-outlet>
    <about></about>

  `,
  styles: []
})
export class App {
  // You can add properties/methods here if needed
